import React, { Component } from 'react';
import Button from 'react-bootstrap/Button';
import '../../css/Landing.css';
import { useAuth0 } from '@auth0/auth0-react';

const LoginButton = () => {
    const { login } = useAuth0();

    return(
        <Button className="button"
            size="lg"
            active
            onClick={() => login()}>
            Log in
        </Button>
    )
}
